import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import LandingPage from './pages/LandingPage';
import WatchHistory from './pages/WatchHistory';
import { Routes } from 'react-router-dom';

function App() {
  return (
   <>
   <div></div>
   <h1>
    Media Player
   </h1>
   <Routes>
   <LandingPage/>
   <Home/>
   <WatchHistory/>
   </Routes>




   </>
  );
}

export default App;
